import * as api from "../helpers/Api";
import store from "../index";
// action Creators
export const getEmployees = () => async (dispatch) => {
  try {
    const token = useSelector((state) => console.log(state, "sssssssstate"));
    console.log(token, "5555555555555");
    const data = await api.fetchEmployees(token);
    dispatch({ type: "FETCH_ALL", payload: data });
  } catch (err) {
    console.log(err);
  }
};
